sys_variable_value.value:
(function execute(inputs, outputs) {
    var gcc = new GoogleCloudComputeUtils();
    gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['projectid', 'name']);
    gcc.maptoOutputFromInput(inputs, outputs, ['projectid']);
    var requestBody = {
        "name": inputs.name,
        "description": inputs.description,
        "properties": {}
    };
    var prop = inputs.properties;
    if (prop.machineType.trim())
        requestBody.properties.machineType = prop.machineType;
    if (prop.disks.length > 0 && prop["disks"][0]['name']) {
        var disks = [];
        prop.disks.forEach(function(disk) {
            disks.push({
                "deviceName": disk['name'],
                "source": disk['name'],
                "boot": disk['boot'],
                "autoDelete": disk['autoDelete'],
                "diskSizeGb": disk['diskSizeGb']

            });
        })
        requestBody.properties.disks = disks;
    }
    if (prop.networkInterfaces.length > 0) {
        var networkInterfaces = [];
        prop.networkInterfaces.forEach(function(networkinteface) {
            var networkURL = "projects/" + inputs.projectid + "/global/networks/default";
            if (networkinteface['newtwork'])
                networkURL = "projects/" + inputs.projectid + "/global/networks/" + networkinteface['newtwork'];
            networkInterfaces.push({
                "network": networkURL
            });
        })
        requestBody.properties.networkInterfaces = networkInterfaces;
    }
   if (prop.labels.length > 0) {
        var labels = {};
        prop.labels.forEach(function(label) {
           if(label['key'])
            labels[label['key']] = label['value'];
        })
        requestBody.properties.labels = labels;
    }
    if (prop.tags.length > 0 && prop.tags[0]) {
        requestBody.properties.tags = {
            "items": prop.tags
        }
    }
    outputs.requestbody = JSON.stringify(requestBody);
})(inputs, outputs);

